// Home.js
import React from 'react';

const Home = () => {
  return (
    <div>
      <h2>Welcome to Deliverance Church Dagoretti Junction</h2>
      <p>Thank you for visiting our website. Explore the various sections to learn more about our church and ministries.</p>
    </div>
  );
}

export default Home;
